import React, { Component } from 'react'
import Tables from '../Style/Tables.css'
class MassageAdmin extends Component {

    constructor() {
        super()
        this.state = {
            massageData: []
        }
    }

    componentDidMount() {
        fetch("http://183.88.219.85:7078/appoint/massage_table.php")
            .then(res => res.json())
            .then(res => {
                this.setState({
                    massageData: res
                })
            })
    }

    render() {
        return (
            <div>
                <table >
                    {this.state.massageData.map(a => (
                        <tr>
                            <td>{a.doctor_name_fname}</td>
                            {a.service.map(b => (
                                <td>
                                    <p>{b.time}</p>
                                    <p>{b.hn}</p>
                                    <p>{b.stat}</p>
                                </td>
                            ))}
                        </tr>
                    ))}
                </table>
            </div>)
    }
}
export default MassageAdmin
